import React, {Component} from "react";
import Sprite from "../game-tools/sprite/Sprite";
import backgroundSprite from "../../src/game-assets/sprite/heroes/heroes1.png";
import Actor from "../game-assets/actor/actor";

function GameContainer() {

    const data = {
        h: 32,
        w: 32
    }

    return(
        <div style={{height: "600px", width: "600px", backgroundColor: "#000000"}}>
            <Actor sprite={backgroundSprite} data={data} />
        </div>
    );
}

export default GameContainer;
